import React from 'react'
import EduItems from "./EduItems"

function Edu() {
  return (
    <div>
        {EduItems.map((item, index) => {
            return(
                <div>
                    <p className={item.cName} key={index}>{item.date} {item.university}</p>
                    <p className={item.cName}>{item.degree}</p>
                </div>
            )
        })}
    </div>
  )
}

export default Edu;
